model Asset {
  id        String          @id
  assetType Asset_assetType
  value     Float
  userId    String
}

model FinancialGoal {
  id       String                 @id
  goalType FinancialGoal_goalType
  target   Float
  deadline DateTime
  userId   String
}

model Liability {
  id            String                  @id
  liabilityType Liability_liabilityType
  amount        Float
  userId        String
}

model User {
  id       String    @id
  username String
  password String
  role     User_role
}

enum Asset_assetType {
  REAL_ESTATE
  STOCKS
  BONDS
